import React, { useState, useEffect } from 'react';
import { Link, useHistory, useParams } from 'react-router-dom';
import EmployeeService from '../services/EmployeeService';

const AddEmployeeComponent = () => {
    const [firstName, setFirstName] = useState('');
    const [lastName, setLastName] = useState('');
    const [emailId, setEmailId] = useState('');
    const [department, setDepartment] = useState('');
    const history = useHistory();
    const { id } = useParams();

    const saveOrUpdateEmployee = (e) => {
        e.preventDefault();

        const employee = { firstName, lastName, emailId, department };

        if (id) {
            EmployeeService.updateEmployee(id, employee).then(() => {
                history.push('/employees');
            }).catch(error => {
                console.log(error);
            });
        } else {
            EmployeeService.createEmployee(employee).then(() => {
                history.push('/employees');
            }).catch(error => {
                console.log(error);
            });
        }
    };

    useEffect(() => {
        if (id) {
            EmployeeService.getEmployeeById(id).then((response) => {
                setFirstName(response.data.firstName);
                setLastName(response.data.lastName);
                setEmailId(response.data.emailId);
                setDepartment(response.data.department);
            }).catch(error => {
                console.log(error);
            });
        }
    }, [id]);

    const title = () => {
        return id ? <h2 className="text-center">Update Employee</h2> : <h2 className="text-center">Add Employee</h2>;
    };

    return (
        <div>
            <br /><br />
            <div className="employee-container">
                <div className="employee-row">
                    <div className="employee-card col-md-6 offset-md-3">
                        {title()}
                        <div className="employee-card-body">
                            <form>
                                <div className="employee-form-group mb-2">
                                    <label className="employee-form-label">First Name:</label>
                                    <input
                                        type="text"
                                        placeholder="Enter first name"
                                        name="firstName"
                                        className="employee-form-input"
                                        value={firstName}
                                        onChange={(e) => setFirstName(e.target.value)}
                                    />
                                </div>

                                <div className="employee-form-group mb-2">
                                    <label className="employee-form-label">Last Name:</label>
                                    <input
                                        type="text"
                                        placeholder="Enter last name"
                                        name="lastName"
                                        className="employee-form-input"
                                        value={lastName}
                                        onChange={(e) => setLastName(e.target.value)}
                                    />
                                </div>

                                <div className="employee-form-group mb-2">
                                    <label className="employee-form-label">Department:</label>
                                    <input
                                        type="text"
                                        placeholder="Enter department"
                                        name="department"
                                        className="employee-form-input"
                                        value={department}
                                        onChange={(e) => setDepartment(e.target.value)}
                                    />
                                </div>

                                <div className="employee-form-group mb-2">
                                    <label className="employee-form-label">Email Id:</label>
                                    <input
                                        type="email"
                                        placeholder="Enter email Id"
                                        name="emailId"
                                        className="employee-form-input"
                                        value={emailId}
                                        onChange={(e) => setEmailId(e.target.value)}
                                    />
                                </div>

                                <button className="btn btn-success" onClick={(e) => saveOrUpdateEmployee(e)}>Submit</button>
                                <Link to="/employees" className="btn btn-danger">Cancel</Link>
                            </form>
                        </div>
                    </div>
                </div>
            </div>
        </div>
    );
};

export default AddEmployeeComponent;
